import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar() {

    return (
        <div className="cursor-pointer flex flex-row items-center justify-between font-mono text-stone-200 bg-header-primary text-sm md:text-md
         xl:text-2xl p-2 2xl:text-4xl">
            <div className='flex flex-row justify-between items-center p-1 mx-auto relative animate-pulse ease-in-out md:mx-0'>
                <div className='p-1'>
                    <WiDayCloudyGusts size={60} />
                </div>
                <div className="flex flex-col font-semibold tracking-tight p-1 items-start relative">
                    <span className="absolute top-3">Daily</span>
                    <span className="absolute top-8">Weather</span>
                </div>
            </div>
            <div className="hidden text-center cursor-pointer tracking-tighter p-1 md:block">
                {new Date().toDateString()}
            </div>
        </div>
    )
}

export default Navbar
